}

class Contact {
    constructor(firstName, lastName, middleName, phoneNumber, avatar, favourite = false, id) {
      this.firstName = firstName;
      this.lastName = lastName;
      this.middleName = middleName;
      this.phoneNumber = phoneNumber;
      this.avatar = avatar;
      this.favourite = favourite;
      this.id = id;
    }
  
    setFavourite(status) {
      this.favourite = status;
    }
  
    editContact(newData) {
      Object.assign(this, newData);
    }
  
    moveToTrash(contactList, trashList) {
      const index = contactList.indexOf(this);
      if (index !== -1) {
        const deletedContact = contactList.splice(index, 1)[0];
        trashList.push(deletedContact);
      }
    }
  }
  
  class ContactList {
    constructor() {
      this.contacts = [];
      this.trash = [];
    }
  
    addContact(contact) {
      this.contacts.push(contact);
    }
  
    moveContactToTrash(contact) {
      contact.moveToTrash(this.contacts, this.trash);
    }
  
    deleteContactFromTrash(contact) {
      const index = this.trash.indexOf(contact);
      if (index !== -1) {
        this.trash.splice(index, 1);
      }
    }
  
    search(query) {
      return this.contacts.filter(contact => (
        contact.firstName.toLowerCase().includes(query.toLowerCase()) ||
        contact.lastName.toLowerCase().includes(query.toLowerCase()) ||
        contact.phoneNumber.includes(query)
      ));
    }
  }
  

  const contactList = new ContactList();
  
  const contact1 = new Contact('Иван', 'Иванов', 'Иванович', '+123456789', 'avatar1.jpg');
  const contact2 = new Contact('Петр', 'Петров', 'Петрович', '+987654321', 'avatar2.jpg');
  
  contactList.addContact(contact1);
  contactList.addContact(contact2);
  
  contact1.setFavourite(true);
  contact2.editContact({ firstName: 'Новое Имя' });
  
  contactList.moveContactToTrash(contact1);

  
  console.log('Все контакты:', contactList.contacts);
  console.log('Корзина:', contactList.trash);

