using namespace std;

 
bool isUperLetter(string password, bool & lenghValid, bool & contentValid, bool & digitValid) {

	contentValid = true;
	int digits = 0;
 

	for (int i = 0; i < password.length(); i++)
	{
		char c = password[i];

		if (isdigit(c)) {
			digits++;
		}

		if (!isalnum(c)) {
			return contentValid = false;
		}

	}

	digitValid = digits >= 2;
	lenghValid = (password.length() >= 6 && password.length() <= 10);

	return (lenghValid && contentValid && digitValid);

}




int main() {

	string password;
	cin >> password;



	bool lenght, content, digit;

	if (isUperLetter(password,lenght, content, digit) == true) {
		cout << "Password is valid" << endl;
	}
	else{
		if (lenght == false) {
		cout << "Password must be between 6 and 10 characters" << endl;
		}
		if (content == false) {
			cout << "Password must consist only of letters and digits" << endl; 
		}
		if (digit == false) {
			cout << "Password must have at least 2 digits" << endl;
		}
	}

}

