using namespace std;

//________________________________________________________________________

template <typename C>
struct SubRange {
	C& collection;
	size_t first_index, last_index;

	auto begin() const {
		return collection.begin() + first_index;
	}

	auto end() const {
		return collection.begin() + last_index;
	}

	size_t size() const {
		return last_index - first_index;
	}

};

template <typename Container>
class Paginator {
private:
	vector<SubRange<Container>> pages;

public:
	Paginator(Container& c, size_t page_size) {
		for (size_t i = 0; i < c.size(); i += page_size) {
			pages.push_back({ c, i,  min(i + page_size, c.size()) });
		}
	}

	auto begin() const {
		return pages.begin();
	}

	auto end() const {
		return pages.end();
	}

	size_t size() const {
		return pages.size();
	}
};

template <typename C>
Paginator<C> Paginate(C& c, size_t page_size) {
	return Paginator<C>(c, page_size);
}

//________________________________________________________________________


template <typename ContainerOfVectors>
void GenerateSingleThread(ContainerOfVectors& result, size_t first_row, size_t column_size) {
	for (auto& row : result) {
		row.reserve(column_size);
		for (size_t column = 0; column < column_size; ++column) {
			row.push_back(first_row ^ column);
		}
		++first_row;
	}
}

vector <vector <int>> GenerateSingleThread(size_t size) {
	vector <vector <int>> result(size);
	GenerateSingleThread(result, 0, size);
	return result;
}

template <typename ContainerOfVectors>
int64_t SumSingleThread(const ContainerOfVectors& matrix) {
	int64_t sum = 0;
	for (const auto& row : matrix) {
		for (const auto& item : row) {
			sum += item;
		}
	}
	return sum;
}

vector <vector <int>> GenerateMultiThread(size_t size, size_t page_size) {
	vector <vector <int>> result(size);
	vector <future <void>> futures;
	size_t first_row = 0;
	for (auto page : Paginate(result, page_size)) {
		futures.push_back(
			async([page, first_row, size] {
				GenerateSingleThread(page, first_row, size);
				})
		);
		first_row += page_size;
	}
	return result;
}


int main() {
	LOG_DURATION("Total");
	const size_t matrix_size = 7000;
	vector <vector <int>> matrix;
	{
		LOG_DURATION("Single thread generation");
		matrix = GenerateSingleThread(matrix_size);
	}
	{
		LOG_DURATION("Multi thread generation");
		matrix = GenerateMultiThread(matrix_size, 2000);
	}
	{
		LOG_DURATION("Single thread sum");
		cout << SumSingleThread(matrix) << endl;
	}
}

import java.util.Arrays;
import java.util.Scanner;

/**
 * freqsort
 */
public class freqsort {

    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        String s = sc.nextLine();
        int l = s.length();
        char[] c = s.toCharArray();
        int[] len = new int[l];
        for (int i = 0; i < s.length(); i++) {
            char ch = s.charAt(i);
            int sum = 0;
            for (int j = 0; j < s.length(); j++) {
                if (ch == s.charAt(j)) {
                    sum++;
                }
            }
            len[i] = sum;
        }
        for (int j = 0; j < s.length(); j++) {

            for (int i = 0; i < s.length() - 1; i++) {

                if (len[i] > len[i + 1]) {
                    int t = len[i + 1];
                    len[i + 1] = len[i];
                    len[i] = t;
                    char r = c[i + 1];
                    c[i + 1] = c[i];
                    c[i] = r;
                }

            }
        }
        int h = len[l - 1];
        for (int i = 1; i <= h; i++) {
            int ind = 0, sum = 0;
            for (int j = 0; j < s.length(); j++) {
                if (i == len[j])
                    sum++;
            }
            for (int j = 0; j < s.length(); j++) {
                if (i == len[j]) {
                    ind = j;
                    break;
                }
            }
            if (sum == 0) {
                continue;
            }
            char[] done = Arrays.copyOfRange(c, ind, ind + sum);
            for (int j = 0; j < sum; j++) {
                for (int j2 = 0; j2 < sum - 1; j2++) {
                    if ((int) done[j2] > (int) done[j2 + 1]) {
                        char r = done[j2 + 1];
                        done[j2 + 1] = done[j2];
                        done[j2] = r;
                    }

                }
            }
            for (int j = 0; j < done.length; j++) {
                if (done[j] != ' ')
                    System.out.print(done[j]);
            }

        }

    }
}

