class Solution {
  public:
    int shortestDistance(int N, int M, vector<vector<int>> A, int X, int Y) {
        
        // code here
        if(A[0][0]!=1)
        {
            return -1;
        }
        queue<pair<int,int>> q;
        int drow[4]={-1,0,1,0};
        int dcol[4]={0,-1,0,1};
        
        vector<vector<int>> dist(N,vector<int>(M,INT_MAX));
        
        q.push({0,0});
        dist[0][0]=0;
        while(!q.empty())
        {
            auto it = q.front();
            q.pop();
            
            int r = it.first;
            int c = it.second;
            
            if(r==X && c==Y)
            {
                return dist[r][c];
            }
            for(int i=0;i<4;i++)
            {
                int nr = r+ drow[i];
                int nc = c+ dcol[i];
                if(nr >=0 && nr<N && nc>=0 && nc<M && A[nr][nc]!=0)
                {
                    if(dist[nr][nc] > 1+dist[r][c])
                    {
                        dist[nr][nc] = 1+dist[r][c];
                        q.push({nr,nc});
                    }
                }
            }
        }
        return -1;
        
    }
};

